export  class Categorie extends Component {

    
    state = {
    loading: true,
    produit: null,
    };

    async    componentDidMount(){
    const listproduit = "https://localhost:44318/api/produits";
    const response = await fetch(listproduit);
    const data = await response.json();
    this.setState({produit: data,loading: false});
    }

    render() {
       
        return (
            <div>{this.state.loading|| !this.state.cat ?(
                <div>loading ...</div>
            ):(
               <div>
                   <div>{this.state.cat.id}</div>
                   <div>{this.state.cat.nameCatégorie}</div>
                   <div>{this.state.cat.imageCatégorie}</div>
               </div>
               )}
               </div>
        );
    }
}

export default Categorie
